import React, { Component } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import { getSpacex } from "../actions/formActions/actions";
import SpacexList from "./spacexList";
import { withStyles } from "@material-ui/core/styles";
import Button from "@material-ui/core/Button";
import { Animated } from "react-animated-css";
import Toolbar from "@material-ui/core/Toolbar";

const styles = {
  header: {
    color: "#E040FB",
    fontFamily: "Righteous",
    fontWeight: "bold",
    fontSize: "3.5vmax",
    position: "relative",
    bottom: "70px",
    marginBottom: "5rem"
  },
  grid: {
    display: "flex",
    flexDirection: "column",
    justifyItems: "center",
    position: "relative",
    bottom: "80px"
  },
  text: {
    color: "#30323e",
    fontFamily: "Quicksand",
    backgroundColor: "rgba(216, 220, 242, 0.6)",
    fontWeight: "bold",
    padding: 30,
    marginTop: 50
  },
  home: {
    color: "#d8dcf2",
    fontSize: "2rem",
    fontFamily: "Lobster, cursive",
    textDecoration: "underline",
    textDecorationColor: "#e040fb"
  },
  body: {
    position: "relative",
    top: 100
  },
  all: {
    backgroundColor: "#212127d3",
    borderRadius: "5%",
    margin: 30
  },
  info: {
    color: "#d8dcf2",
    fontFamily: "Quicksand",
    fontWeight: "bold",
    fontSize: "3vmax",
    position: "relative",
    bottom: "100px"
  },
  picture: {
    maxWidth: "100%",
    maxHeight: "100vh",
    margin: "auto"
  },
  button1: {
    position: "relative",
    top: 50,
    backgroundColor: "#e040fb",
    marginBottom: 70,
    margin: 50,
    width: 300,
    height: 50
  },
  button2: {
    position: "relative",
    top: 50,
    marginBottom: 70,
    margin: 50,
    width: 300,
    height: 50
  },
  about: {
    fontFamily: "Righteous"
  }
};
class SpacexResult extends Component {
  componentDidMount() {
    this.props.getSpacex();
  }
  render() {
    return (
      <React.Fragment>
        {this.props.receivedInfo.info.map(i => (
          <SpacexList
            flight_number={i.flight_number}
            img_src={i.img_src}
            mission_name={i.mission_name}
            launch_year={i.launch_year}
            rocket_name={i.rocket.rocket_name}
            mission_patch={i.links.mission_patch}
            video_link={i.links.video_link}
          />
        ))}
      </React.Fragment>
    );
  }
}

const mapDispatchToProps = {
  getSpacex: getSpacex
};

SpacexResult.propTypes = {
  classes: PropTypes.object.isRequired
};

const withstyles = withStyles(styles)(SpacexResult);
const spacexResultConnected = connect(
  null,
  mapDispatchToProps
)(withstyles);
export default spacexResultConnected;
